    for(let i=0;i<arr.length();i++){

    }
}

export function return_component(number,arr){

    return(                
        <>

        {
            select_emp_name_id(number).map((item,index)=>{
                return(
                    <Id_name  component_state={number} key={(index)} item={item} />
                )
            })
        }
        </>)
}

export function Id_name({item,component_state}){


        if(component_state===1){
            return(
            <div className="employee">
                <input placeholder={item[0]}  type='text'/>
                <input placeholder={item[1]} type='text'/>
                <input placeholder={item[2]} type='text'/>
                <input placeholder={item[3]} type='text'/>
                <input placeholder={item[4]} type='text'/>
                <input placeholder={item[5]} type='text'/>
                <input placeholder={item[6]} type='text'/><br/>
            </div>
            )


        }
        else if(component_state===2){
            return(
                <div className="employee">
                <input placeholder={item[0]}  type='text'/>
                <input placeholder={item[1]} type='text'/>
                <input placeholder={item[2]} type='text'/>
                <input placeholder={item[3]} type='text'/><br/>
                </div>
            )

        }
        else{
            return(
                <div className="employee">
                <input placeholder={item[0]}  type='text'/>
                <input placeholder={item[1]} type='text'/><br/>
                </div>
            )

        }


}
